INSERT INTO `databaseInput_type` (`id`, `name`, `isModification`, `pfamName`, `pfamId`, `description`, `pfamGraphic`, `smashName`) VALUES (1,'A',0,'AMP-binding (+ AMP-binding C)','PF00501','Adenylation-Domain\r\nSpecific activation of amino acid by adenylation\r\nPfam recognises different domains even though it\'s only one.','{\"type\" : \"pfama\",\"text\" : \"A-Domain\",\"colour\" : \"#82FA58\",\"display\" : \"true\",\"startStyle\" : \"curved\",  \"endStyle\" : \"curved\"}','AMP-binding'),(2,'C',0,'Condensation','PF00668','Condensation Domain\r\nBuilds peptide bond between two amino acids, each covalenty bound to a thiolation domain. It has a specificity for the chirality of the donor amino acid and for the acceptor amino acid. Thus the latter specificity is the same as that of the following adenylation domain.\r\nPfam also recognises epimerisation domains as condensation domains.','{\"type\" : \"pfama\",\"text\" : \"C-Domain\",\"colour\" : \"#ff5353\",\"display\": \"true\",\"startStyle\" : \"curved\",\"endStyle\" : \"curved\"}',NULL),(3,'T',0,'PP-binding','PF00550','Thiolation Domain\r\nDomain covalently carrying amino acids and peptides via thioester bond.','{\"type\" : \"pfama\",\"text\" : \"T-Domain\",\"colour\" : \"#FF00FF\",\"display\" : \"true\",\"startStyle\" : \"curved\",\"endStyle\" : \"curved\"}','PCP'),(4,'TE',0,'','PF00975.13','Thioesterase Domain\r\nSynthesis terminating domain, which can introduce a heterocycle depending on the amino acid sequence.','{\"type\" : \"pfama\",\"text\" : \"TE-Domain\",\"colour\" : \"#0040FF\",\"display\" : \"true\",\r\n\"startStyle\" : \"curved\",\"endStyle\" : \"curved\"}','Thioesterase'),(5,'E',0,'Condensation','PF00668','Epimerisation Domain\r\nRacemises the amino acid to be introduced. Specificity for chirality given by condensation domain.\r\nAny sole condensation domain at the end of a synthesase in Pfam is an epimerisation domain.','{\"type\" : \"pfama\",\"text\" : \"E-Domain\",\"colour\" : \"#F4FA58\",\"display\" : \"true\",\"startStyle\" : \"curved\",\"endStyle\" : \"curved\"}','Epimerization'),(6,'Cy',0,'','','Condensation domain additionally introducing a heterocycle.','{\"type\" : \"pfama\",\"text\" : \"Cyclisation\",\"colour\" : \"#e4a396\",\"display\": \"true\",\"startStyle\" : \"curved\",\"endStyle\" : \"curved\"}','Heterocyclization'),(7,'M',0,NULL,NULL,'','',NULL),(8,'Nm',0,'','','N-methylation-domain','{\"type\" : \"pfama\",\"text\" : \"A-Domain\",\"colour\" : \"#82FA58\",\"display\" : \"true\",\"startStyle\" : \"curved\",  \"endStyle\" : \"curved\"}','nMT'),(9,'Om',0,'','','O methylation domain','{\"type\" : \"pfama\",\"text\" : \"O-methylation-Domain\",\"colour\" : \"#82FA58\",\"display\" : \"true\",\"startStyle\" : \"curved\",  \"endStyle\" : \"curved\"}','oMT'),(10,'C_L',0,'','','Condensation Domain\r\nBuilds peptide bond between two amino acids, each covalenty bound to a thiolation domain. It has a specificity for the chirality of the donor amino acid and for the acceptor amino acid. Thus the latter specificity is the same as that of the following adenylation domain.\r\nPfam also recognises epimerisation domains as condensation domains.','{\"type\" : \"pfama\",\"text\" : \"C-Domain\",\"colour\" : \"#ff5353\",\"display\": \"true\",\"startStyle\" : \"curved\",\"endStyle\" : \"curved\"}','Condensation_LCL'),(11,'C_D',0,'','','Condensation Domain\r\nBuilds peptide bond between two amino acids, each covalenty bound to a thiolation domain. It has a specificity for the chirality of the donor amino acid and for the acceptor amino acid. Thus the latter specificity is the same as that of the following adenylation domain.\r\nPfam also recognises epimerisation domains as condensation domains.','{\"type\" : \"pfama\",\"text\" : \"C-Domain(D)\",\"colour\" : \"#ff5353\",\"display\": \"true\",\"startStyle\" : \"curved\",\"endStyle\" : \"curved\"}','Condensation_DCL'),(12,'NCOM',0,'','','N terminal communication domain','{\"type\" : \"pfama\",\"text\" : \"N-terminal-communication-Domain\",\"colour\" : \"#82FA58\",\"display\" : \"true\",\"startStyle\" : \"curved\",  \"endStyle\" : \"curved\"}','NRPS-COM_Nterm'),(13,'CCOM',0,'','','C-terminal communication domain','{\"type\" : \"pfama\",\"text\" : \"C-terminal communication domain\",\"colour\" : \"#82FA58\",\"display\" : \"true\",\"startStyle\" : \"curved\",  \"endStyle\" : \"curved\"}','NRPS-COM_Cterm'),(14,'C_St',0,'Condensation','PF00668','Starting Condensation Domain\r\nBuilds peptide bond between the second amino acid and some activated molecule. The latter does not have to be bound to a thiolation domain, but needs an activated acid residue. This is mostly a fatty acid, some chromphor or a different species specific metabolite. The domain has a specificity for the acceptor amino acid which thus is the same as that of the following adenylation domain. There was no global information found about the acidic molecule specificity. \r\nPfam also recognises this as condensation domains.','{\"type\" : \"pfama\",\"text\" : \"Starter-C-Domain\",\"colour\" : \"#ff5353\",\"display\": \"true\",\"startStyle\" : \"curved\",\"endStyle\" : \"curved\"}','Condensation_Starter'),(15,'C_gl',0,'','','C domain with substrate specificity introducing a glycosidic linkage, e.g. between HpG or DHpG components and also sugars. Prominent examples are all glycopeptide antibiotics such as vancomycin and teicoplanin.','{\"type\" : \"pfama\",\"text\" : \"C-glyc-Domain\",\"colour\" : \"#ff5353\",\"display\": \"true\",\"startStyle\" : \"curved\",\"endStyle\" : \"curved\"}','Cglyc'),(16,'Misc',0,'','','Collection of all miscellaneous domains, that can\'t be used with the designer right now. These are for example inactive domains, domains of unknown function or very special domains.','{\"type\" : \"pfama\",\"text\" : \"Misc\",\"colour\" : \"#b88a00\",\"display\": \"true\",\"startStyle\" : \"curved\",\"endStyle\" : \"curved\"}',''),(17,'C_du',0,'','','Condesation domain which also carries an epimerisation function. It is specific for donor and acceptor amino acid and changes the donor to D-conformation.','{\"type\" : \"pfama\",\"text\" : \"dual CE-Domain\",\"colour\" : \"#ff5353\",\"display\": \"true\",\"startStyle\" : \"curved\",\"endStyle\" : \"curved\"}','Condensation_Dual'),(18,'AOxA',0,'','','Combined adenylation/oxidation/adenylation domain which appears in indigoidine synthetases','{\"type\" : \"pfama\",\"text\" : \"AOxA-Domain\",\"colour\" : \"#82FA58\",\"display\" : \"true\",\"startStyle\" : \"curved\",  \"endStyle\" : \"curved\"}','AOxA'),(19,'C_Xg',0,'','','Hybrid of glycosilating condensation and epimerisation domain of unknown function.','{\"type\" : \"pfama\",\"text\" : \"CXglyc-Domain\",\"colour\" : \"#ff5353\",\"display\": \"true\",\"startStyle\" : \"curved\",\"endStyle\" : \"curved\"}','CXglyc'),(20,'T_Ep',0,'','','T domain before epimerization domain','{\"type\" : \"pfama\",\"text\" : \"T-Domain\",\"colour\" : \"#FF00FF\",\"display\" : \"true\",\"startStyle\" : \"curved\",\"endStyle\" : \"curved\"}',''),(21,'Tstd',0,'','','standard T domain that does NOT precede Epimerization domain ','{\"type\" : \"pfama\",\"text\" : \"T-Domain\",\"colour\" : \"#FF00FF\",\"display\" : \"true\",\"startStyle\" : \"curved\",\"endStyle\" : \"curved\"}','');
/*!40000 ALTER TABLE `databaseInput_type` ENABLE KEYS */;
